  [],\n\t\"revision_timestamp\": \"2016-04-05T00:01:33.681207\",\n\t\"name\": \"enviroatlas-phoenix-az-one-meter-resolution-urban-land-cover-data-2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The EnviroAtlas Phoenix, AZ land cover
  (LC) data and map were generated from USDA NAIP (National Agricultural Imagery Program)
  four band (red, green, blue and near-infrared) aerial photography taken from June
  through September, 2010 at 1 m spatial resolution. Seven land cover classes were
  mapped: water, impervious surfaces, soil and barren land, trees and forest, shrubs,
  grass and herbaceous non-woody vegetation, and agriculture. An accuracy assessment
  using a completely random sampling of 598 land cover reference points yielded an
  overall accuracy of 69.2%. The area mapped includes the entirety of the Central
  Arizona-Phoenix Long-Term Ecological Research (CAP-LTER) area, which was classified
  by the Environmental Remote Sensing and Geoinformatics Lab (ERSG) at Arizona State
  University. The land cover dataset also includes an area of approximately 625 square
  kilometers which is located north of Phoenix. This section was classified by the
  EPA land cover classification team. This dataset was produced by the US EPA to support
  research and online mapping activities related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
  allows the user to interact with a web-based, easy-to-use, mapping application to
  view and analyze multiple ecosystem services for the contiguous United States. The
  dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
